{"operationName":"BasisVaults","variables":{},"query":"query BasisVaults {
  basisVaults(first: 1000, where: {isActive: true}) {
    id
    lpToken {
      id
      name
      symbol
      decimals
      __typename
    }
    depositToken {
      id
      symbol
      decimals
      __typename
    }
    createdAt
    createdBlock
    __typename
  }
}"}

